TURN_IN_ITEMS = "Требующиеся предметы:"; -- Lists the items needed to turn in to complete a quest
TUTORIAL1 = "Над головами персонажа, который может дать вам задание, отображается восклицательный знак. Чтобы поговорить с таким персонажем, подойдите к нему и щелкните по нему правой кнопкой мыши.";
TUTORIAL2 = "Вы можете передвигаться при помощи клавиш A, S, D, W либо клавиш стрелок, или удерживая одновременно левую и правую кнопки мыши.";
TUTORIAL3 = "Вы можете поворачивать камеру, водя мышью по игровому полю при нажатой левой кнопке. Вы также можете поворачивать одновременно персонажа и камеру, водя мышью при нажатой правой кнопке.";
TUTORIAL4 = "Левая кнопка мыши - выбор цели, правая кнопка мыши - взаимодействие.";
TUTORIAL5 = "В режим боя можно войти, указав щелчком правой кнопки мышки цель и приблизившись к ней на необходимую для боя дистанцию. Сражение с противником начинается автоматически.";
TUTORIAL6 = "Чтобы применить заклинание или способность, щелкните мышью по соответствующему значку панели команд. Эта панель расположена в левой нижней части экрана.";
TUTORIAL7 = "Чтобы обыскать труп, щелкните по нему правой кнопкой мыши. После этого можно щелкнуть правой кнопкой по предметам в окне добычи, чтобы переложить их в свой рюкзак.";
TUTORIAL8 = "Теперь этот предмет находится в вашем рюкзаке. Чтобы открыть рюкзак, щелкните по его изображению в правом нижнем углу экрана. Наведите указатель мыши на предмет, чтобы узнать о нем больше.";
TUTORIAL9 = "Чтобы использовать предмет, щелкните по нему правой кнопкой мыши. Значки часто используемых предметов можно переместить на панель команд.";
TUTORIAL10 = "Вы можете разместить сумки в пустых местах для сумок в нижней правой части экрана, рядом с рюкзаком, и затем щелкнуть по ним левой кнопкой мыши, чтобы открыть.";
TUTORIAL11 = "Чтобы быстро восполнить здоровье, велите персонажу что-нибудь съесть, щелкнув по значку пищи на панели команд. Учтите, что в ходе боя здоровье не восполняется.";
TUTORIAL12 = "Чтобы быстро восполнить ману, велите персонажу что-нибудь выпить. Для этого щелкните по значку напитка, расположенному на панели команд.";
TUTORIAL13 = "Приобрести новый талант или развить уже имеющийся можно в соответствующем окне. Чтобы его открыть, щелкните по мигающей кнопке, расположенной на панели команд.";
TUTORIAL14 = "Обратитесь к учителю в начальной зоне, чтобы приобрести новый навык. Возможно, учителя вашего класса придется поискать.";
TUTORIAL15 = "Чтобы переместить значок заклинания или способности на панель команд, вызовите меню заклинаний и способностей с помощью кнопки в центре нижней части экрана. Затем перенесите нужный значок на панель команд с помощью мыши. Заклинания и способности можно применять не только с помощью панели команд, но и непосредственно из меню.";
TUTORIAL16 = "Вы можете узнать свою репутацию среди представителей различных групп и организаций в соответствующей закладке в окне персонажа.";
TUTORIAL17 = "Вы можете ответить этому игроку, нажав клавишу R и затем напечатав послание, или напечатав /шепнуть <имя игрока> и послание.";
TUTORIAL18 = "Пригласить игрока в группу можно, щелкнув правой кнопкой мыши по его портрету и выбрав \"пригласить\" во всплывающем меню.";
TUTORIAL19 = "За этого персонажа играет живой игрок. Это видно по тому, что у него над головой - имя, написанное синими буквами.";
TUTORIAL20 = "Если щелкнуть правой кнопкой мыши по предмету в окне торговца, предмет будет куплен – при условии, что у вас достаточно денег. Если щелкнуть правой кнопкой по предмету из рюкзака, когда открыто окно торговца, предмет будет продан.";
TUTORIAL21 = "Вы можете открыть свой журнал заданий, щелкнув кнопкой мыши по золотому кубку в центре панель команд внизу экрана. Там вы сможете перечитать информацию о задании.";
TUTORIAL22 = "Если вам понравилось играть с кем-то из игроков, добавьте его в свой список друзей! Это можно сделать с помощью панели общения.";
TUTORIAL23 = "Вы можете сказать что-нибудь, нажав клавишу ENTER и набрав сообщение. Игроки, находящиеся поблизости, вас услышат.";
TUTORIAL24 = "Чтобы надеть предмет или взять его в руки, откройте окно персонажа с помощью кнопки, расположенной в центре нижней части экрана, а затем переместите значок предмета из рюкзака на изображение персонажа.";
TUTORIAL25 = "Вы стали призраком. Вы можете вернуться к жизни, если найдете свое тело или поговорите с ближайшим целителем душ. Расположение вашего тела отображается в виде значка на мини-карте в верхней правой части экрана.";
TUTORIAL26 = "Вы отдыхаете. Отдых дает временные преимущества в получении опыта при убийстве монстров.";
TUTORIAL27 = "Заплыв в глубокие и неизведанные воды, вы увидите индикатор усталости. Окончательно устав, вы начнете тонуть.";
TUTORIAL28 = "Плавание почти ничем не отличается от ходьбы, за исключением того, что при плавании вы можете всплывать или погружаться, нажимая правую кнопку мыши и глядя в ту сторону, куда хотите направиться.";
TUTORIAL29 = "Когда ваш персонаж окажется под водой, вы увидите индикатор дыхания. Когда дыхания станет не хватать, вы начнете тонуть.";
TUTORIAL30 = "Вы отдыхаете, и ваш портрет светится желтым. Отдохнув или выйдя из игры, вы получите временные преимущества в получении опыта при убийстве монстров.\nВы можете обратиться к хозяину таверны, а затем использовать камень возвращения, чтобы быстро вернуться обратно.";
TUTORIAL31 = "Теперь у вас есть камень возвращения. С его помощью вы можете мгновенно вернуться в последний трактир, где был приобретен такой камень. Камень возвращения можно использовать раз в час.";
TUTORIAL32 = "Вы вступили в бой в режиме \"игрок против игрока\". Когда вы участвуете в бою \"игрок против игрока\", рядом с вашим портретом возникает знак вашего союза, и вражеские игроки могут атаковать вас.";
TUTORIAL33 = "Вы можете нажать \"Пробел\", чтобы персонаж подпрыгнул. Прыжки помогут миновать препятствия и могут пригодиться, если у вас возникнут проблемы с тем, чтобы выбраться из воды на твердую землю.";
TUTORIAL34 = "Вы выполнили первое задание! Чтобы получить награду, необходимо вернуться к персонажу, который дал вам задание. После выполнения задания позиция соответствующего поручителя задания появляется на мини-карте, при условии, что вы находитесь поблизости.";
TUTORIAL35 = "Вы обратились к одному из распорядителей полетов. Они обучают животных перевозить пассажиров на большие расстояния. За небольшую плату вы можете быстро добраться до другого распорядителя полетов, с которым вы уже знакомы. Оказавшись в новом городе, найдите распорядителя полетов - это позволит вам легко вернуться туда в будущем.";
TUTORIAL36 = "Прочность одного из ваших предметов на исходе. На изображении персонажа под мини-картой поврежденный предмет выделен желтым. Найдите в городе торговца, чтобы починить предмет, пока он не сломался.";
TUTORIAL37 = "Что-то из вашей экипировки испорчено! Испорченный предмет обозначен красным на изображении персонажа, которое находится под мини-картой. Вы можете починить испорченную вещь у торговца в городе. До того, как ее починят, вам от нее никакой пользы не будет.";
TUTORIAL38 = "Ваш персонаж может изучить две профессии, которые позволят вам создавать ценные предметы или добывать материалы для их создания. Если вы хотите узнать о профессиях больше, стражники в любом большом городе подскажут, где найти учителей.";
TUTORIAL39 = "Чтобы легче одержать победу над врагами, вы можете пригласить других игроков в свою команду. Большинство трудных заданий быстро выполняются в группе, при этом награда за выполнение задания распределяется среди ее членов. Кроме того, группа получает дополнительный опыт относительно получаемого при индивидуальной игре.";
TUTORIAL40 = "Вы освоили новое заклинание или способность! Вызовите меню заклинаний и способностей, щелкнув по соответствующему значку панели команд. Для доступа к различным категориям навыков и заклинаний воспользуйтесь вкладками в правой части меню.";
TUTORIAL41 = "Вы приняли элитное задание. Подобные задания лучше выполнять в группе, потому что для их выполнения приходится забираться в области, населенные элитными созданиями. Они значительно мощнее, чем обычные монстры, но приносят больше опыта. Элитного монстра можно узнать по золотому дракону на рамке его портрета.";
TUTORIAL42 = "Когда вы будете встречаться с чем-то новым, внизу экрана будет появляться кнопка помощи. Нажав ее, вы сможете получить подсказку. Сначала подсказки будут совсем простыми, но со временем они будут касаться все более и более сложных вопросов.\n\nДобро пожаловать в русскоязычную версию World of Warcraft! Удачи вам в ваших приключениях!";
TUTORIAL43 = "У персонажа с серым значком \"!\" над головой есть задание, которое вам недоступно из-за недостаточно высокого уровня. Попробуйте еще раз, когда ваш уровень станет выше.";
TUTORIAL44 = "Вы приобрели оружие дальнего боя. Поместите его в соответствующее место на изображении персонажа, вызовите меню заклинаний и способностей и переместите значок стрельбы или метания на панель команд.";
TUTORIAL45 = "Невозможно стрелять из луков и ружей, не имея боеприпасов. Чтобы приобрести боеприпасы, зайдите в городе к торговцу луками или ружьями. Чтобы сложить боеприпасы в сумку, щелкните по ним правой кнопкой мыши.";
TUTORIAL46 = "Вы присоединились к рейдовой группе, имеющей ограничение в 40 участников. \n\n|cffff2020 Находясь в рейдовой группе, вы не сможете получать награды за выполнение нерейдовых заданий, требующих убивать монстров или собирать предметы.|r";
TUTORIAL47 = "Вы ожидаете у камня встреч, чтобы присоединиться к группе. Счетчик камня встреч отображается в виде выноски на мини-карте. Для того чтобы выйти из очереди камня встреч, нужно щелкнуть по счетчику кнопкой мыши.";
TUTORIAL48 = "Вы находитесь в очереди на поле боя. Вы можете проверить свой статус, наведя указатель мыши на значок на своей мини-карте.";
TUTORIAL49 = "\"Теперь вы можете вступить в бой. Нажмите \"Вступить в бой\" в диалоговом окне либо наведите указатель мыши на значок поля боя на мини-карте и щелкните правой кнопкой мыши\".";
TUTORIAL50 = "Теперь у вас есть связка для хранения ключей от подземелий. Связка ключей появляется слева от сумок на панели команд.";
TUTORIAL51 = "Чтобы найти группу, к которой вы можете присоединиться, используйте интерфейс поиска групп. Для его вызова щелкните по значку с глазом в центре панели команд или нажмите клавишу \"l\".";
